import React, {Component, Fragment} from 'react';
import {Link} from 'react-router-dom';
import './UserProfileStyles.css';

export class UserNavBar extends Component {
    render(){
        return (
            <Fragment>
                <nav className="navbar navbar-expand-lg navbar-light bg-light">
                    <div className="collapse navbar-collapse" id="navbarSupportedContent">
                        <ul className="navbar-nav mr-auto">
                            <li className="nav-item active" > <Link to = '/' className="nav-link"> main page </Link> </li>
                            <li className="nav-item"> <Link to = '/feedback' className="nav-link"> feed back </Link> </li>
                            <li></li>
                            <li></li>
                            <li></li>
                        </ul>
                        <form className="form-inline my-2 my-lg-0">
                            <p> <input className="form-control mr-sm-2" type="search" aria-label="Search" placeholder = 'search'/>  </p>
                            <button className="myBtn" type="submit"> search </button>
                        </form>
                    </div>
                </nav>
            </Fragment>
        )
    }
}


export default UserNavBar;
